<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name=" viewport" content="width=device-width,initial-scale=1" />
    <title>fish</title>
    <link rel="stylesheet" href="./style5.css" />
  </head>
  <body>
    <div class="main">
      <div class="fish-body-cont">
        <div class="eye-cont">
          <div class="left-eye">
            <div class="internal-eye-part">
              <div class="pupil">
                <div class="internal-eye">
                  <div class="blink"></div>
                </div>
              </div>
            </div>
          </div>
          <div class="right-eye">
            <div class="internal-eye-part1">
              <div class="pupil2">
                <div class="internal-eye1">
                  <div class="blink"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="nose1"></div>
        <div class="nose2"></div>
        <div class="nose3"></div>
        <div class="nose4"></div>
        <div class="nose5"></div>
        <div class="nose6"></div>
        <div class="mouth">
          <div class="teeth"></div>
          <div class="tongue"></div>
        </div>
      </div>
      <div class="fish-face"></div>
      <div class="ear-cont">
        <div class="left-ear"></div>
        <div class="right-cont"></div>
      </div>
      <div class="fish-tail-cont">
        <div class="fishtail-int"></div>
      </div>
      <div class="extra1"></div>
      <div class="extra2"></div>
      <div class="fish-left-fing"></div>
      <div class="fish-right-fing"></div>
    </div>
  </body>
</html>
